import React from 'react';
import avatarka from '../image/down2.jpg';
import p from './Post.module.css';

const Post = (props) => {
  let mymsg = [
    { img: avatarka, ike: 'like', msg: 'barior axperner' },
    { img: avatarka, ike: 'like', msg: 'inchka chka' },
  ];

  return (
    <div className={p.post}>
      {mymsg.map((pst) => {
        return (
          <div className={p.item}>
            <img src={pst.img} />
            {pst.msg}
            <div>
              <span>
                <b>{pst.ike}</b>
              </span>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Post;
